import React from "react";
import { Link } from "react-router-dom";

const Navigation = () => {
  return (
    <nav>
      <ul>
        <li>
          <Link to="/payment">결제</Link>
        </li>
        <li>
          <Link to="/payment/complete">결제 완료</Link>
        </li>
      </ul>
    </nav>
  );
};

export default Navigation;
